import React, { Component } from "react";
import { Link, Redirect, withRouter, NavLink } from "react-router-dom";
import "./Test.css";
import axios from "axios";
import authService from "../../services/auth-service";
import axiosService from "../../services/axios-service";
import { API_URL } from "../../services/url";
import SimpleReactValidator from "simple-react-validator";
import { SuccessModal } from "./SuccessModal";

const initialState = {

  btnstatus : false,
  total_SMC1 : "",
  total_SMC2 : "",
  total_SMC3 : "",
  total_SMC4 : "",
  query :"",
  supplier: "",
  source: "",
  sample_location: "",
  weight: "",
  agg_type: "",
  weight_balance: "",
  weight_sample_testing: "",
  weight_sample_sieving: "",
  material_passing: "",
  pto_comment: "",
  total_wa1 : "",
  total_wa2 : "",
  total_wa3 : "",
  total_wa4: "",
  wa1 : "",
  wa2 : "",
  wa3 : "",
  wa4 : "",
  total_vs1: "",
  total_vs2: "",
  total_vs3: "",
  total_vs4: "",
  total_vd1: "",
  total_vd2: "",
  total_vd3: "",
  total_vd4: "",
  total_surf_moist1 : "",
  total_surf_moist2 : "",
  total_surf_moist3 : "",
  total_surf_moist4 : "",
  testing_quantity: "",
  plant: "",
  spg1: "",
  spg2: "",
  spg3: "",
  spg4: "",
  s_r1: "",
  s_r2: "",
  s_r3: "",
  s_r4: "",
  s_r5: "",
  s_r6: "",
  s_r7: "",
  s_r8: "",
  s_r9: "",
  s_r10: "",
  s_r11: "",
  s_t1: "",
  s_t2: "",
  s_t3: "",
  s_t4: "",
  s_t5: "",
  s_t6: "",
  s_t7: "",
  s_t8: "",
  s_t9: "",
  s_t10: "",
  s_t11: "",
};


export class SurfaceMoisture extends Component {
  constructor(props) {
    super(props);
    this.state = {
      initialState,
      formstatus: false,
      amount_status: false,
      _isMounted : false,
      uppercardstatus : true
    };
    this.onSubmit = this.onSubmit.bind(this);
    this.validator = new SimpleReactValidator();
    this.showformhandle = this.showformhandle.bind(this);
  }
  componentWillMount = () => {
    var today = new Date();
    var dd = today.getDate();
    var mm = today.getMonth() + 1; //January is 0!
    var yyyy = today.getFullYear();

    if (dd < 10) {
      dd = "0" + dd;
    }

    if (mm < 10) {
      mm = "0" + mm;
    }

    today = mm + "/" + dd + "/" + yyyy;
    console.log("date here", today);
    this.state.date = today;
    console.log(this.state.date);

    this.setState({
      _isMounted : true
    })
  };

  change = e => {
    this.setState({
      [e.target.name]: e.target.value
    });
  };
  openModal() {
    this.setState({
        visible : true
    });
}

  closeModal() {
    this.setState({
        visible : false
    });
  }
  getInfo = async () => {
    try {
      let vendor_name = this.state.query
      const response = await axios.get(
        `${API_URL}master/vendor_search?VENDOR_NAME=${vendor_name}`,
        (axios.defaults.headers.common["x-access-token"] = localStorage.getItem("token"))
      );
     // console.log(response.data.User);
      //console.log(this.state.supl);
      console.log('response hwew', response)

      if (response.data.success) {
        await this.setState({
          supl: response.data.VENDOR_NAME
        })
        console.log(this.state.supl);
      }
      // this.parseJSON(this.state)
    } catch (error) {
      console.log(error);
    }


  }
  handleInputChange = (e) => {
    console.log(e.target.value)
    this.setState({
      query: e.target.value
    }, () => {
      if (this.state.query && this.state.query.length > 1) {
        if (this.state.query.length % 2 === 0) {
          if(this.state._isMounted)
          {
          this.getInfo()
          }
        }
      } else if (!this.state.query) {
      }
    })
  }
  showformhandle() {
    const doesShow = this.state.formstatus;
    this.setState({ formstatus: !doesShow });
    this.setState(initialState);
  }
  getWebsite = () => {
    fetch("/").then(console.log(this.state));
  };
  async onSubmit(event) {
    event.preventDefault();
    console.log(this.state);
    if (this.validator.allValid()) {
      let tokenvalue = localStorage.getItem("token");
      let type;
      if (this.state.formstatus) {
        type = "RF_16";
      } else {
        type = "RF_15";
      }
      let body = {
        total_SMC1 : this.state.total_SMC1,
        total_SMC2 : this.state.total_SMC2,
        total_SMC3 : this.state.total_SMC3,
        total_SMC4 : this.state.total_SMC4,
        supplier: this.state.query,
        source: this.state.source,
        sample_location: this.state.sample_location,
        weight: this.state.weight,
        weight_balance: this.state.weight_balance,
        weight_sample_testing: this.state.weight_sample_testing,
        weight_sample_sieving: this.state.weight_sample_sieving,
        material_passing: this.state.total,
        pto_comment: this.state.pto_comment,
        plant: localStorage.getItem("plant_name"),
        date: this.state.date,
        type: type,
        total_wa1 : this.state.total_wa1,
        total_wa2 : this.state.total_wa2,
        total_wa3 : this.state.total_wa3,
        total_wa4 : this.state.total_wa4,
        wa1 : this.state.wa1,
        wa2 : this.state.wa2,
        wa3 : this.state.wa3,
        wa4 : this.state.wa4,
        s_r1: this.state.s_r1,
        spg1: this.state.spg1,
        spg2: this.state.spg2,
        spg3: this.state.spg3,
        spg4: this.state.spg4,
        total_vs1: this.state.total_vs1,
        total_vs2: this.state.total_vs2,
        total_vs3: this.state.total_vs3,
        total_vs4: this.state.total_vs4,
        total_vd1: this.state.total_vd1,
        total_vd2: this.state.total_vd2,
        total_vd3: this.state.total_vd3,
        total_vd4: this.state.total_vd4,
        total_surf_moist1 : this.state.total_surf_moist1,
        total_surf_moist2 : this.state.total_surf_moist2,
        total_surf_moist3 : this.state.total_surf_moist3,
        total_surf_moist4 : this.state.total_surf_moist4,
        s_r2: this.state.s_r2,
        s_r3: this.state.s_r3,
        s_r4: this.state.s_r4,
        s_r5: this.state.s_r5,
        s_r6: this.state.s_r6,
        s_r7: this.state.s_r7,
        s_r8: this.state.s_r8,
        s_r9: this.state.s_r9,
        s_r10: this.state.s_r10,
        s_r11: this.state.s_r11,
        s_t1: this.state.s_t1,
        s_t2: this.state.s_t2,
        s_t3: this.state.s_t3,
        s_t4: this.state.s_t4,
        s_t5: this.state.s_t5,
        s_t6: this.state.s_t6,
        s_t7: this.state.s_t7,
        s_t8: this.state.s_t8,
        s_t9: this.state.s_t9,
        s_t10: this.state.s_t10,
        s_t11: this.state.s_t11
      };
      console.log(body);
      this.openModal();
      this.setState({
        btnstatus : true
      })
      try {
        const response = await axios.post(
          `${API_URL}rf_form/submit`,
          body,
          (axios.defaults.headers.common["x-access-token"] = tokenvalue)
        );
        console.log(response);
        //   .then(console.log(this.state));

        if (response.data==='success') {
          // alert(response.data);
          this.props.history.push("/ViewTestThree");
        } else {
          alert(response.data);
        }
      } catch (error) {
        console.log(error);
      }
    } else {
      this.validator.showMessages();
      // rerender to show messages for the first time
      this.forceUpdate();
    }
  }

  total_VS = e => {
    function isNumber(n) {
      return !isNaN(parseFloat(n)) && isFinite(n);
    }
    e.preventDefault();
    if (

      isNumber(this.state.s_t1) &&
      isNumber(this.state.s_t3) &&
      isNumber(this.state.s_t5) 
    ) {
      let Vs = (+this.state.s_t1 + +this.state.s_t3) - +this.state.s_t5;
      console.log("total_vs", Vs);
      this.state.total_vs1 = Vs.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //vs2
    if (
      isNumber(this.state.s_r1) &&
      isNumber(this.state.s_r3) &&
      isNumber(this.state.s_r5) 
    ) {
      let Vs2 = (+this.state.s_r1 + +this.state.s_r3) - +this.state.s_r5;
      console.log("total_vs", Vs2);
      this.state.total_vs2 = Vs2.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //v3
    if (
      isNumber(this.state.s_t2) &&
      isNumber(this.state.s_t4) &&
      isNumber(this.state.s_t6) 
    ) {
      let Vs3 = (+this.state.s_t2 + +this.state.s_t4) - +this.state.s_t6;
      console.log("total_vs", Vs3);
      this.state.total_vs3 = Vs3.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //v4
    if (
      isNumber(this.state.s_r2) &&
      isNumber(this.state.s_r4) &&
      isNumber(this.state.s_r6) 
    ) {
      let Vs4 = (+this.state.s_r2 + +this.state.s_r4) - +this.state.s_r6;
      console.log("total_vs", Vs4);
      this.state.total_vs4 = Vs4.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    this.setState({
      amount_status: true
    });
  };
  total_VD = e => {
    function isNumber(n) {
      return !isNaN(parseFloat(n)) && isFinite(n);
    }
    e.preventDefault();
    if (
      this.state.spg1 != 0 &&
      isNumber(this.state.s_t3) &&
      isNumber(this.state.spg1)
    ) {
      let Vd = +this.state.s_t3 / +this.state.spg1;
      console.log("total_vd", Vd);
      this.state.total_vd1 = Vd.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //vd2
    if (
      this.state.spg2 != 0 &&
      isNumber(this.state.s_r3) &&
      isNumber(this.state.spg2)
    ) {
      let Vd2 = +this.state.s_r3 / +this.state.spg2;
      console.log("total_vd", Vd2);
      this.state.total_vd2 = Vd2.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //v3
    if (
      this.state.spg3 != 0 &&
      isNumber(this.state.s_t4) &&
      isNumber(this.state.spg3)
    ) {
      let Vd3 = +this.state.s_t4 / +this.state.spg3;
      console.log("total_vd", Vd3);
      this.state.total_vd3 = Vd3.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //v4
    if (
      this.state.spg4 != 0 &&
      isNumber(this.state.s_r4) &&
      isNumber(this.state.spg4)
    ) {
      let Vd4 = +this.state.s_r4 / +this.state.spg4;
      console.log("total_vd", Vd4);
      this.state.total_vd4 = Vd4.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    this.setState({
      amount_status: true
    });
  };
  total_surfaceMoisture = e => {
    function isNumber(n) {
      return !isNaN(parseFloat(n)) && isFinite(n);
    }
    e.preventDefault();
    //surf1
    if (
      isNumber(this.state.total_vd1) &&
      isNumber(this.state.s_t3) && 
      isNumber(this.state.total_vs1)
    ) {
      if (this.state.total_vd1 != this.state.s_t3) {
        let surf_moist1 = 100 * ((+this.state.total_vs1 - +this.state.total_vd1) / (+this.state.s_t3 - +this.state.total_vd1));
       this.state.total_surf_moist1 = surf_moist1.toFixed(2)
        console.log('surfaceoisutre1',surf_moist1)


      } else {
        console.log("error");
      }
    } 
    // else alert("please enter the valid input in field");
    //surf2
    if (
      isNumber(this.state.total_vd2) &&
      isNumber(this.state.s_r3) && 
      isNumber(this.state.total_vs2)
    ) {
      if (+this.state.total_vd2 != +this.state.s_r3) {
        let surf_moist2 = 100 * ((+this.state.total_vs2 - +this.state.total_vd2) / (+this.state.s_r3 - +this.state.total_vd2));
        this.state.total_surf_moist2 = surf_moist2.toFixed(2)
        console.log('surfaceoisutre2',surf_moist2)
      } else {
        console.log("error");
      }
    } 
    // else alert("please enter the valid input in field");
    //surf3
    if (
      isNumber(this.state.total_vd3) &&
      isNumber(this.state.s_t4) && 
      isNumber(this.state.total_vs3)
    ) {
      if (+this.state.total_vd3 != +this.state.s_t4) {
        let surf_moist3 = 100 * ((+this.state.total_vs3 - +this.state.total_vd3) / (+this.state.s_t4 - +this.state.total_vd3));
        this.state.total_surf_moist3 = surf_moist3.toFixed(2)
        console.log('surfaceoisutre3',surf_moist3)
      } else {
        console.log("error");
      }
    } 
    // else alert("please enter the valid input in field");
    //surf4
    if (
      isNumber(this.state.total_vd4) &&
      isNumber(this.state.s_r4) && 
      isNumber(this.state.total_vs4)
    ) {
      if (+this.state.total_vd4 != +this.state.s_r4) {
        let surf_moist4 = 100 * ((+this.state.total_vs4 - +this.state.total_vd4) / (+this.state.s_r4 - +this.state.total_vd4));
        this.state.total_surf_moist4 = surf_moist4.toFixed(2)
        console.log('surfaceoisutre4',surf_moist4)
      } else {
        console.log("error");
      }
    } 
    // else alert("please enter the valid input in field");
    this.setState({
      amount_status: true
    });
  };
  total_WA = e => {
    function isNumber(n) {
      return !isNaN(parseFloat(n)) && isFinite(n);
    }
    e.preventDefault();
    if (
      isNumber(this.state.s_t3) &&
      isNumber(this.state.s_t1)
    ) {
      if(this.state.s_t3 === 0)
      {
        alert('please give correct input')
      }
      else
      {
      let C1 = ((+this.state.s_t1-this.state.s_t3) / +this.state.s_t3)*100
      this.state.total_wa1 = C1.toFixed(2)
      console.log(C1)
      }
    } 
    // else alert("please enter the valid input in field");
    //vd2
    if (
      isNumber(this.state.s_r3) &&
      isNumber(this.state.s_r1)
    ) {
      if(this.state.s_r3 === 0)
      {
        alert('please give correct input')
      }
      else
      {
      let C2 = ((+this.state.s_r1-this.state.s_r3) / +this.state.s_r3)*100
      this.state.total_wa2 = C2.toFixed(2)
      console.log(C2)
      }
    } 
    // else alert("please enter the valid input in field");
    //v3
    if (
      isNumber(this.state.s_t2) &&
      isNumber(this.state.s_t4)
    ) {
      if(this.state.s_t4 === 0)
      {
        alert('please give correct input')
      }
      else
      {
      let C3 = ((+this.state.s_t3-this.state.s_t4) / +this.state.s_t4)*100
      this.state.total_wa3 = C3.toFixed(2)
      console.log(C3)
      }
    } 
    // else alert("please enter the valid input in field");
    //v4
    if (
      isNumber(this.state.s_r2) &&
      isNumber(this.state.s_r4)
    ) {
      if(this.state.s_r4 === 0)
      {
        alert('please give correct input')
      }
      else
      {
      let C4 = ((+this.state.s_r3-this.state.s_r4) / +this.state.s_r4)*100
      this.state.total_wa4 = C4.toFixed(2);
      console.log(C4)
      }
    } 
    // else alert("please enter the valid input in field");
    this.setState({
      amount_status: true
    });
  };
  total_SMC = e => {
    function isNumber(n) {
      return !isNaN(parseFloat(n)) && isFinite(n);
    }
    e.preventDefault();
    if (
      isNumber(this.state.wa1) &&
      isNumber(this.state.total_wa1)
    ) {
      let SMC1 = +this.state.total_wa1 - +this.state.wa1;
      console.log("total_smc1", SMC1);
      this.state.total_SMC1 = SMC1.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //vd2
    if (
      isNumber(this.state.wa2) &&
      isNumber(this.state.total_wa2)
    ) {
      let SMC2 = +this.state.total_wa2 - +this.state.wa2;
      console.log("total_smc2", SMC2);
      this.state.total_SMC2 = SMC2.toFixed(2);
    } 
    // else alert("please enter the valid input in field");
    //v3
    if (
      isNumber(this.state.wa3) &&
      isNumber(this.state.total_wa3)
    ) {
      let SMC3 = +this.state.total_wa3 - +this.state.wa3;
